To solve this, we need to calculate the ionization energy of the hydrogen atom which has $e^+e-$ and then calculate the ground state energy of the positronium by using the relativistic version of the ionization energy for the electron. relativistic version ionization energy for the electron: 
\begin{align*}
E_0= \frac{-\mu z^4 e^4}{2\hbar^2}
\end{align*}
where z is the relativistic correction. z is given by $ \frac{1}{\sqrt{1-\frac{1}{c^2v^2}}}$$&=\frac{1}{\sqrt{1-\frac{v^2}{c^2}}}$, in a non relativistic atom z=1.
